commits.content:
*{
    box-sizing: border-box;
}
body {
    margin: 0;
    background-color: #30023a;
}
nav {
    background-color: #5c0c6e;
    height: 60px;
}
nav ul {
    margin: auto;
    text-align: end;
    padding: 10px;
}
nav li {
display: inline-block;
}
header b {
    font-family: Verdana, Geneva, Tahoma, sans-serif;
    color: deepskyblue;
    position: absolute;
    font-size: 40px;
}
header b a{
    color: red;
}
nav a {
    text-decoration: none;
    padding: 10px;
    color: white;
    font-size: 20px;
    margin-right: 20px;
}
li a:hover{
    color: yellow;
    transition: all 4s;
    padding: 5px;
}
button{
    padding: 13px;
    background: #b22fd0;
    border-radius: 7px;
    color: white;
}
h4 {
    margin-top: 100px;
    text-align: center;
    color: rgb(185, 156, 197);
}
h2 {
    text-align: center;
    font-size: 50px;
    color: white;
}
p {
    text-align: center;
    color: crimson;
}
.button {
    display: flex;
    padding: 10px;
    gap: 10px;
    justify-content: center;
}
input[type="button"]{
    padding: 20px;
    width: 150px;
    border-radius: 9px;
    border: none;
    color: white;
    background-color: rgb(136, 67, 155);
}
 div h4 {
    color: antiquewhite;
    font-size: 40px;
    font-weight: lighter;

}
 div p {
    color: rgb(158, 197, 197);
    font-size: 20px;
    font-weight: lighter;
}
.box {
    height: max-content;
    width: max-content;
    display: flex;
    gap: 40px;
}
.box1{
    height: 180px;
    width: 400px;
    background-color: rgb(38, 38, 87);
    border-radius: 20px;
}
.box1 h3 {
    color: black;
}
.box1 img{
    margin-top: 20px;
    height: 70px;

    border-radius: 100px;
   margin-left: 200px;
}
.box2 {
    height: 180px;
    width: 400px;
    background-color: beige;
    border-radius: 20px;

}
